# --------------------------------------------------------------------------------------------------------------------
# https://www.weather.gov/help-map
# NWS_cols[ ,1] : List of all warnings, watches, advisories, and statements 
# NWS_cols[ ,2] : Associated colors for all warnings, watches, advisories, and statements.
NWS_cols = read.csv("NationalWeatherService_Events.csv", header=TRUE)

# https://alerts.weather.gov/cap
# atlantic_codes[ ,1] : Zone code
# atlantic_codes[ ,2] : Zone name
# atlantic_codes[ ,3] : Ocean
atlantic_codes = read.csv("NationalWeatherService_AtlanticCodes.csv", header=TRUE)[29:42, ]

# Function extracting alerts from an NWS XML file.
source("NWS_AlertParseFunc.R")

# --------------------------------------------------------------------------------------------------------------------
# Create empty vectors.
xml_info <- mat.or.vec(length(atlantic_codes$code), 3)

# # Start the clock!
# ptm <- proc.time()

# Run through each station url.
for(i in 1:length(atlantic_codes$code)){
  # Run the function parsing the data we want.
  xml_info[i,1:3] <- parse_xml(as.character(atlantic_codes$code[i]))
}

